import styled from "styled-components";
import Nav from "../components/Nav";
import SimButton from "../components/SimButton";

const RightBG = styled.div`
  position: fixed;
  top: 0;
  right: 0;
  width: 50vw;
  height: 100vh;
  background-color: var(--dark-gray);
  z-index: -1;
  display: flex;
  align-items: top;
  justify-content: center;
`;

const BGLine1 = styled.div`
  width: calc(100% - 100px);
  height: calc(100% - 140px);
  margin-top: 100px;
  border: solid 2px var(--gray);
  background-color: transparent;

  z-index: -1;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const LeftSection = styled.div`
  width: 50vw;
  height: 80vh;
  display: flex;
  justify-content: center;
  align-items: center;
`;
const BGLine2 = styled(BGLine1)`
  margin: 0;
  width: calc(100% - 20px);
  height: calc(100% - 20px);
`;

const PlayerSection = styled.div`
  border: solid red;
  position: fixed;
  top: 50%;
  left: 50%;
`;

function Simulator() {
  return (
    <div>
      <Nav />

      <LeftSection>
        <SimButton />
      </LeftSection>

      <PlayerSection></PlayerSection>

      <RightBG>
        <BGLine1>
          {" "}
          <BGLine2></BGLine2>
        </BGLine1>
      </RightBG>
    </div>
  );
}

export default Simulator;
